INSERT INTO `products` VALUES (1,'ZEB-SD52 SSD 512GB, SATA II and SATA III Interface, QLC, Silent Operation','About this itemFaster performance, Smart & Silent operation512GB, Ultra low power consumptionFlash Interface QLCSequential Read Speed 550MB/s Sequential Write Speed 480MB/s',2099,40,'1','2025-01-16 18:41:06',NULL,'1'),(2,'FRONTECH 775/1155 CPU Cooling Fan with Universal Socket & Heat Sink for Better Air Circulation, Super Silent, De-Vibrating, HS Sunflower Design, (CPF-0002, Black)','Give your PC a way to ventilate hot air and keep air flow for a cooled system. Fan speed 3000 RPM. Max Airflow. 55 CFM.Make your CPU cooler with this super cooling fan. It creates a flow of air that pushes heat out of your system preventing any overheating.An easy to install application that gets attached to your PCs CPU effortlessly. With a sunflower design that also improves the looks of your frame.Dissipate heat effectively with more air flow and less heat present. Helps you perform heavy tasks without damaging any internal parts.The super silent performance with de-vibration helps you perform your task in peace.',239,15,'1','2025-01-16 18:41:06',NULL,'1'),(3,'Galaxy Microsystems Ltd., Galaxy Microsystems Ltd., Hong Kong, Kowloon Bay, Wang Chiu Rd, 33, Exchange Tower, Room 1601, 16th Floor','Advanced Cooling System: Equipped with 4 vibrant RGB cooling fans and a high-performance mesh front panel for superior airflow, ensuring optimal cooling efficiency even during intense gaming sessions.Crystal-Clear Display: The innovative hinged magnetic tempered glass door provides a clear view of your PC\'s components, showcasing your high-performance hardware in style.Enhanced Connectivity: Features 1x USB 3.0, 2x USB 2.0 ports, alongside dedicated 3.5mm microphone and headphone jacks for seamless connectivity. Includes a convenient reset button and a responsive power button for easy operation.Versatile Liquid Cooling Support: Supports various liquid cooling configurations including front (240mm/280mm/360mm), top (240mm/280mm), and rear (120mm), enabling you to unleash the full potential of advanced cooling solutions for overclocking and intensive tasks.Spacious Interior Design: Offers ample room to accommodate ATX, M-ATX, and ITX motherboards, ensuring compatibility with a wide range of gaming setups and hardware configurations.Optimized Graphics Card Compatibility: Supports graphics cards up to 330mm in length, allowing you to install the latest high-performance GPUs without compromise.Sleek and Modern Aesthetic: Boasts a minimalist design with clean lines, adding a sophisticated touch to your gaming rig while complementing any gaming environment.',3379,4300,'1','2025-01-16 18:41:06',NULL,'1'),(4,'HP All-in-One PC, Windows 11 Home, Intel Processor N200, 21.45-Inch (54.5 Cm), FHD, Intel UHD Graphics, 720P HD Camera W/Privacy Shutter, Dual Speakers (Win 11, White, 4.17 Kg), Dg0154In','4-core Intel Processor N200 Experience reliable performance with a processor that features 4 threads and 6MB L3 cache for smooth multitasking and fast processing.Intel UHD graphics Enjoy immersive visuals with Intel UHD graphics. Perfect for both work and entertainment, it delivers crystal-clear images for an enhanced viewing experience.Substantial memory and storage The 8GB DDR5 RAM ensures efficient multitasking, while the 512GB PCIe NVMe SSD provides ample storage space for all your files and applications.Micro-edge display Immerse yourself in the 21.45\" FHD, anti-glare, and micro-edge display. Experience vivid colors and sharp details with 99% sRGB for an unforgettable viewing experience.Seamless connectivity Stay connected with Wi-Fi 6 (1x1) and Bluetooth 5.3. It also features 1 x USB Type-C, 4 x USB Type-A, 1 x RJ-45, and 1 x HDMI-out 1.4 port for easy connectivity.HD Conferencing The HP True Vision 720p HD camera with temporal noise reduction ensures clear video calls. The dual speakers offer high-quality audio for an improved conferencing experience.Why HP C